    LeadGenerationComponent.prototype.getMatchingProz = function (zipcodeResponse, basicobj) {
        var _this = this;
        var headers = new _angular_http__WEBPACK_IMPORTED_MODULE_5__["Headers"]();
        headers.append("Accept", 'application/json');
        headers.append('Content-Type', 'application/json');
        var options = new _angular_http__WEBPACK_IMPORTED_MODULE_5__["RequestOptions"]({ headers: headers });
        this.http.get(_global_global__WEBPACK_IMPORTED_MODULE_8__["Global"].url + '/getListOfProzDetails', options)
            .subscribe(function (data) {
            var matchingProz = data.json();
            if (matchingProz.status == 200) {
                //console.log("matchingProz" + JSON.stringify(matchingProz))
                for (var i = 0; i < zipcodeResponse.length; i++) {
                    for (var j = 0; j < matchingProz.response.length; j++) {
                        if (matchingProz.response[j].zipCode == zipcodeResponse[i].zip_code && matchingProz.response[j].certifiedPro == "Yes") {
                            //console.log("Matching" + JSON.stringify(Math.max(parseInt(matchingProz.response[j].aggregateRating))))
                            _this.ratingArray.push(matchingProz.response[j]);
                            localStorage.setItem('ratingarray', JSON.stringify(_this.ratingArray));
                            _this.zipCodeArray.push(matchingProz.response[j].zipCode);
                            _this.dataDummyServiceSubCat = false;
                            _this.dataServiceParent = false;
                            _this.dataDummyServiceParent = true;
                            _this.dataServiceProjectDesc = false;
                            _this.dataFormReg = false;
                            _this.noMatchingProz = false;
                        }
                        else {
                            //console.log("Not Matching")
                            _this.dataDummyServiceSubCat = false;
                            _this.dataServiceParent = false;
                            _this.dataDummyServiceParent = false;
                            _this.dataServiceProjectDesc = false;
                            _this.dataFormReg = false;
                        }
                        if (i == zipcodeResponse.length - 1 && j == matchingProz.response.length - 1) {
                            //console.log("Strictly for UnMatching")
                            if (_this.zipCodeArray.length == 0) {
                                _this.noMatchingProz = true;
                                //console.log("EMPTY")
                                //console.log("Strictly for UnMatching but it is approved")
                                localStorage.setItem('mainId', basicobj.mainId);
                                _this.router.navigate(['/customer/selectedService', _this.activatedRoute.snapshot.params['serviceName'].trim(), 'NOPRO', 'STD']);
                                return false;
                            }
                            else {
                                //console.log("NOT EMPTY")
                                //console.log("parentId" + basicobj.parentId)
                                //console.log("type" + basicobj.type)
                                _this.dummyCategories();
                            }
                        }
                    }
                }
            }
        }, function (error) {
            _this.toastr.warning('Unable to Connect to Server');
        });
    };
